import React, { Component } from 'react';

class Logo extends Component {
    render() {
        return (
            <div>
                <img src="./images/logo.jpg" alt='logo prizoners' style={{width:"50%", height:"50%", padding: "20px 0"}}/>
            </div>
        );
    }
}

export default Logo;
